import React, { Fragment } from 'react'

const Team = () => {
  return (<Fragment>
    <div className="w-100 h-100 h-pr-fl-ma centered b-s-b-b bg-orange">
      <div className="w-100px h-100px h-pr-fl-ma bg-red b-s-b-b "><span className="w-a h-a h-pr-fl-ma centered ">LOGO</span></div>
      </div>
    </Fragment>
  )
}

export default Team
